import FrameImg from '../assets/img/frame3/Group1.png'

const FrameApi = [
    {
        frameImg: [
            {
                img: FrameImg,
            }
        ],
        FrameText: [
            {
                text: 'о нашем походе'
            },
            {
                text: 'Исследуйте все горные массивы мира вместе с нами'
            }
        ]

    }
]
export default FrameApi
